import React, { useState } from 'react';
import "./../css/CardContainer.css"


function importAll(r) {
    return r.keys().map(r);
  }
var cardPaths={
    "Things":require.context("./../images/things", false, /\.(png|jpe?g|svg)$/),
    "Trigger":require.context("./../images/sensors", false, /\.(png|jpe?g|svg)$/),
    "Feedback":require.context("./../images/feedbacks", false, /\.(png|jpe?g|svg)$/)
}
function onCardClick(id){
    var card=document.getElementById(id)
    card.setAttribute()
}

function CardContainer(props) {
    const listOfImages=importAll(cardPaths[props.category]);
    console.log({props})
    const [imageClass,setImageClass] = useState(["card"]);
    const imageClasses=imageClass.map((a)=> a).join(" ")
    return (
        <div>
        {listOfImages.map(
            (image,index) =>  <img onClick={() => setImageClass({ imageClass: imageClass.push("ass") })}  className={imageClasses} id={index} key={index} src={image.default} ></img>
        )}
        </div>
    );
}

export default CardContainer;
